import React from 'react'
import './Detail.css'
import List from './List'
import recommendProduct from './recommendProduct'


function Detail({asin, buylink, category, imglink, name, price, seq}) {
  return (
    <div>
        <List />
        <recommendProduct />
    </div>
    
  )
}

export default function App() {
    return (
        <div>
            <List />
            <recommendProduct />
        </div>
    );
}
